import React from 'react';
import { Button } from 'react-native';

function CustomButton({ title, onPress, color, size }) {
  // return <Button color={color} size={size} title={title} onPress={onPress} />;
  return (
  <TouchableOpacity 
    style={{ 
      color: color,
      size: size,
      }} 
    onPress={onPress}>
  <Text>{{title}}</Text>
</TouchableOpacity>);
}

export default CustomButton;
